import React, { Component } from 'react';

class Footer extends Component{
    render() {
      return <div className="header">
      <div className="logo">
      </div>
      <ul>
        <li><Link to="/about">About</Link></li>
        <li><Link to="/inbox">Inbox</Link></li>
      </ul>
      {this.props.children}
    </div>
    }
}

export default Footer;
